import React from "react";
import { Route, Switch } from "react-router";
import FormProduto from "./components/formprodutos/FormProduto";
import ListaProduto from "./components/listaprodutos/ListaProduto";


export default function App() {

    return (
        <Switch>
            <Route path="/" exact component={ListaProduto}/>
            <Route path="/incluir" component={FormProduto}/>
            <Route path="/editar/:id" component={FormProduto}/>
        </Switch>
    )

}
